import React from "react";
import "../blocks/Interests.css";

export default function Interests() {
  return (
    <div className="interests__container">
      <h2 className="interests__title">Interests</h2>
      <p className="interests__description">Registered Nurse. Gym Bro. Gamer. Travel. Real Estate Investing.</p>
    </div>
  );
}
